import { VictoryChart, VictoryLine, VictoryAxis } from "victory";
import { bgColor3e, bgColorGreen, bgColorR1 } from "../../Styles/backGroundColor";
import React from "react";

export function CIVictoryLine(props){
    var {border="10px solid #ccc", 
            interpolation="basis", bg=bgColor3e, lableX="", lableY="", width=500, height=250, lineColor="red", transperente=false} = props

    //colors
    const colors = ["white", bgColorGreen, bgColorR1]

    const { data } = props;

    return (
        <VictoryChart minDomain={{ y: 0 }} width={width} height={height} style={{background: { fill:bg}}} id={props.ke}>
        
        <VictoryAxis
        // headline for X
        label={lableX}
        // style
        style={{
          axisLabel: { padding: 30},
          tickLabels: { fontSize: 10, fill:"white"}
        }}
      />
      <VictoryAxis
        dependentAxis
        // headline for y
        label={lableY}
        // style
        style={{
          axisLabel: { padding: 40 },
          tickLabels: { fontSize: 10, fill:"white"}
        }}
      />

        <VictoryLine 
            animate={{
                duration: 2000,
                onLoad: { duration: 2000 }}}
            style={{data: {stroke:lineColor, parent: { border:{border}}}}}
            interpolation={interpolation}
            data={data}/>
    </VictoryChart>
    )
}
